// para navegar no header
import { Link } from 'react-router-dom' ;

function Header(){
    return(
        <header>
            <nav>
                <ul class="nav_links">
                    <Link to="/">Home</Link>
                    <Link to="/sobre">Sobre</Link>
                    <Link to="/">Contato</Link>
                    <Link to="/">Projetos</Link>            
                </ul>
            </nav>
            <a class="'cta" href="#"><button>Contato</button></a>
        </header>
    )
}

export default Header;
